import AppDispatcher from '../dispatcher'
import AppSignal from 'appsignal'
import Plan from 'api/plan'

export default {
  getPlanRemainingDays (id) {
    return Plan.GetPlanRemainingDays(id)
      .then(response => {
        AppDispatcher.handleAction({
          actionType: 'REMAINING_DAYS_RECEIVED',
          data: response
        })
      })
      .catch(error => {
        AppSignal.sendError(new Error(error))
        throw error
      })
  }
}
